import React, { Component } from "react";
import TransaksiService from "../services/TransaksiService";

class ViewUserComponent extends Component {
  constructor(props) {
    super(props);

    this.state = {
      id: this.props.match.params.id,
      user: {},
    };
  }

  componentDidMount() {
    UserService.getUserById(this.state.id).then((res) => {
      this.setState({ transaksi: res.data });
    });
  }

  render() {
    return (
      <div>
        <br></br>
        <div className="card col-md-6 offset-md-3">
          <h3 className="text-center">View Transaksi Details</h3>
          <div className="card-body">
            <div className="row">
              <label> Date: </label>
              <div> {this.state.transaksi.date}</div>
            </div>
            <div className="row">
              <label> Description: </label>
              <div> {this.state.user.description}</div>
            </div>
            <div className="row">
              <label> Amount: </label>
              <div> {this.state.transaksi.amount}</div>
            </div>
            <div className="row">
              <label> Status: </label>
              <div> {this.state.transaksi.status}</div>
            </div>
            <div className="row">
              <label> Receiver: </label>
              <div> {this.state.transaksi.receiver}</div>
            </div>
            <div className="row">
              <label> Jenis Kelamin: </label>
              <div> {this.state.transaksi.jk}</div>
            </div>
            <div className="row">
              <label> No Telphone: </label>
              <div> {this.state.transaksi.no_telp}</div>
            </div>
            <div className="row">
              <label> Address: </label>
              <div> {this.state.transaksi.address}</div>
            </div>
          </div>
        </div>
      </div>
    );
  }
}

export default ViewUserComponent;
